VALUES ('19360849', 'crevettes beurre diabolique', 'creettes 64% [crevettes (Litopenaeus vannamei), eau, sel, correcteurs d\'acidité (E330, E331)], beurre 29%, chapelure (farine de blé, eau, sel, levure), épices (tomate en poudre, sel, oignon en poudre, ail, persil, fromage en poudre, extrait de levure, poivre, paprika, arôme naturel), pâte de curry rouge (ail, piments rouges séchés, citronnelle, échalote, sel galanga, pâte de crevettes, zeste de citron kaffir, poivre), poivre de Cayenne, correcteur d\'acidité (E325), conservateur (EZ202) .ре Bevat: gluten, schaaldieren, melk. Gemaakt in een bedrijf waar ook eieren, vis, soja, selderij, mosterd, lupine,weekdieren en sulfieten worden verwerkt./Contient: gluten, crustacés, lait. Fabriqué dans un atelier qui utilise aussi: oeufs, poisson, soja, céleri, moutarde, lupin, mollusques et sulfites. Bereiding: Microgolfoven: verwijder de plastic verpakking, plaats het aluminium schoteltje op een bord en verwarm gedurende 3 minuten op 600W. Traditionele oven: verwijder de plastic verpakking, plaats het aluminiu schoteltje gedurende 10 minuten in een voorverwarmde oven op 200°C. Préparation: Four à micro-ondes: retirez l\'emballage en plastique, mettez ln he assiette et faites réchauffer pendant 3 minutes à 600W. Four tradit mettez la barquette en aluminium pendant 10 minutes au four pre GEMIDDELDE VOEDINGSWAARDE PER 100G/VALEUR NUTRI Energie: 1381 kl/', 'https://static.openfoodfacts.org/images/products/19360849/front_fr.4.400.jpg', '29.1', '7.9', '3.8', '', '', '13.7', '1.3', '0.511811023622047', '0', '0');

