VALUES ('2000000023483', '86 feuilletés apéritif', 'Pâte dorée (63%) : farine de BLE (GLUTEN de blé) margarine (huiles et graisses végétales de palme et colza, eau, sel, émulsifiant : mono- et diglycérides d\'acides gras, correcteur d\'acidité : acide citrique), eau, sel, LACTOSE, protéines de LAIT, CREME en poudre, OEUFS en poudre. Garniture (37%) : Apéritif Champignons : eau, champignons (5.4%), cèpes (4.6%), CREME fraîche, amidons modifiés de pomme de terre, préparation pour béchamel en poudre (LACTOSERUM, amidon modifié de pomme de terre, LACTOSE, CREME en poudre, LAIT écrémé en poudre, farine de BLE, sel, poivre, muscade), arôme naturel (contient BLE), sel, ail, persil, poivre. Apéritif lardons / oignons : eau, lardons cuits salés (7.2%) (poitrine de porc, sel, dextrose de blé, correcteur d\'acidité : acide citrique, antioxydant : érythorbate de sodium, conservateur : nitrite de sodium), CREME fraîche, préparation pour béchamel en poudre (LACTOSERUM, amidon modifié de pomme de terre, LACTOSE, CREME en poudre, LAIT écrémé en poudre, farine de BLE, sel, poivre, muscade), EMMENTAL râpé, oignons rissolés (3.4%) (oignons, huile végétale de tournesol), LACTOSERUM, LAIT écrémé en poudre, amidon modifié de pomme de terre, OEUFS en poudre, arôme naturel (contient LAIT). Apéritif Chorizo : purée de tomate, poivrons, eau, double concentré de tomate, chorizo précuit (3.5%) (viande de porc, épices et plantes aromatiques, sel, sirop de glucose, dextrose, arômes naturels, antioxydant : acide ascorbique, conservateur : nitrite de sodium), préparation pour béchamel en poudre (LACTOSERUM, amidon modifié de pomme de terre, LACTOSE, CREME en poudre, LAIT écrémé en poudre, farine de BLE, sel, poivre, muscade), amidon modifié de pomme de terre, OEUFS en poudre, ail, sucre, sel, poivre. Saupoudrage : mix paprika (épices et extraits d\'épices dont paprika, sel).', 'https://static.openfoodfacts.org/images/products/200/000/002/3483/front_fr.4.400.jpg', '', '', '', '', '', '', '', '', '', '0');

